import { useState, useEffect } from 'react';
import { Button, Modal, Input, List } from 'antd';

const SearchBar = () => {
  const [input, setInput] = useState('');
  const [results, setResults] = useState([]);
  const [address, setaddress] =  useState('');

  const mapboxToken = 'pk.eyJ1IjoiaGljY3VwLXN0YWZmIiwiYSI6ImNsangxeHVkbzAyNmwzdHJ4cmJiYWZmMm4ifQ.yI4259jlMq2elDiT_uK1kg';

  const  fetchCoordinates = async () => {
    try {
      const response = await fetch(
        `https://api.mapbox.com/geocoding/v5/mapbox.places/${address}.json?access_token=${mapboxgl.accessToken}`
      );

      if (response.ok) {
        const data = await response.json();
        const [longitude, latitude] = data.features[0].center;
        setnewlat(latitude);
        setnewlgn(longitude);
      } else {
        console.error('Error fetching coordinates:', response.statusText);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  }

  useEffect(() => {
    if (input) {
      // Fetch and update results based on user input
      const fetchResults = async () => {
        try {
          const response = await fetch(
            `https://api.mapbox.com/geocoding/v5/mapbox.places/${input}.json?access_token=${mapboxToken}`
          );
          if (response.ok) {
            const data = await response.json();
            console.log(data.features);
            setResults(data.features);
          } else {
            console.error('Error fetching results:', response.statusText);
          }
        } catch (error) {
          console.error('Error:', error);
        }
      };

      fetchResults();
    } else {
      // Clear results when input is empty
      setResults([]);
    }
  }, [input]);

  const handleItemClick = (selectedValue) => {
    console.log('Selected Item:', selectedValue);
    set
  };


  return (
    <div>
      < Input
        type="text"
        placeholder="Recherche d'une localisation:"
        value={input}
        onChange={(e) => setInput(e.target.value)}
      />
     <List
      dataSource={results}
      onClick={() => onItemClick(result.place_name)}
      style={{ cursor: 'pointer' }}
      renderItem={(result, index) => (
        <List.Item>
          {result.place_name}
        </List.Item>
      )}
    />
    </div>
  );
};

export default SearchBar;
